inline:
div, a, button {
  border-radius: 0px !important;
}

.fern-button:not(.disabled).filled.primary {
  --tw-ring-color: #c6fccc !important;
  background-color: #c6fccc !important;
  color: #000000 !important;
  transition: all .2s ease-out;
  font-family: 'JetBrainsMono-Medium' !important;
  font-weight: bolder !important;
}

.fern-button:not(.disabled).filled.primary svg {
  color: #000000 !important;
}

.fern-button:not(.disabled).filled.primary:hover svg {
  color: #ffffff !important;
}

.fern-button:not(.disabled).filled.primary:hover {
  --tw-ring-color: #000000 !important;
  background-color: #000000 !important;
  color: #ffffff !important;
  transition: all .2s ease-out;
  font-family: 'JetBrainsMono-Medium' !important;
}

.fern-button:not(.disabled).minimal {
  font-family: 'JetBrainsMono-Medium' !important;
  font-weight: bolder !important;
}

/* Hide built with fern footer link */
a.inline-flex.items-baseline.gap-1 {
  display: none;
}
